export default function App(props) {

  const postsState = useSelector((store: RootStore) => store.blog)

  const { Component, pageProps } = props;
  return (
    <Provider store={store}>
      {/* <Component {...pageProps} /> */}
      <ul>
        <li>
          <p>fbsbsd</p>
          <p>dbsdsbsd</p>
          <p>sdbsdbds</p>
        </li>
      </ul>
    </Provider>
  );
}
